"use strict";function ajax(t){var e=new XMLHttpRequest;e.open("GET",t,!0),e.onload=function(){if(e.status>=200&&e.status<400){var t=e.responseText;grabTag(t,"main")}},e.send()}function grabTag(t,e){var n=document.createElement("html");return n.innerHTML=t,n.getElementsByTagName(e)[0]}var links=document.querySelectorAll("a");Array.prototype.forEach.call(links,function(t){t.onclick=function(t){t.preventDefault();var e=this.getAttribute("href");ajax(e)}});